svg.script:
const svgElement = document.getElementById('Layer_1');
if (svgElement) {
  const pathContainer = svgElement.querySelector('g.st7'); // Target g.st7

  if (pathContainer) {

    // --- Add Invisible Background for Consistent Hover ---
    // Calculate the bounding box of the container *after* it's rendered
    const containerBBox = pathContainer.getBBox();
    const backgroundRect = document.createElementNS('http://www.w3.org/2000/svg', 'rect');
    backgroundRect.setAttribute('x', containerBBox.x);
    backgroundRect.setAttribute('y', containerBBox.y);
    backgroundRect.setAttribute('width', containerBBox.width);
    backgroundRect.setAttribute('height', containerBBox.height);
    backgroundRect.setAttribute('fill', 'transparent'); // Make it invisible
    // Or use: backgroundRect.setAttribute('opacity', '0');
    backgroundRect.setAttribute('pointer-events', 'all'); // Crucial: Make it capture mouse events
    // Insert the background rect as the first child, so it's behind the paths
    pathContainer.insertBefore(backgroundRect, pathContainer.firstChild);
    // --- End Background ---

    const paths = Array.from(pathContainer.querySelectorAll('path')); // Get paths inside g.st7
    const pathData = [];

    // --- Configurable Parameters ---
    const baseRadiusOfInfluence = 100; // Base radius for hover effect (pixels)
    let radiusOfInfluence = baseRadiusOfInfluence; // Current radius (will be animated)
    const maxScale = 1.5;          // Max scale of the closest element
    const minScale = 1.0;          // Base scale
    const rippleDuration = 600;    // Duration of ripple animation in ms (faster)
    const maxRippleRadius = 700;   // Maximum radius during ripple animation (wider)
    let isRippling = false;       // Flag to track if ripple animation is active
    let rippleX = 0;              // X coordinate of ripple center
    let rippleY = 0;              // Y coordinate of ripple center
    let rippleStartTime = 0;      // When the ripple animation started
    // -----------------------------

    // Pre-calculate centers and add class
    paths.forEach(path => {
      // Add class only if CSS needs it, JS controls transform directly
      // path.classList.add('interactive-path');
      const bbox = path.getBBox();
      const cx = bbox.x + bbox.width / 2;
      const cy = bbox.y + bbox.height / 2;
      pathData.push({ element: path, cx, cy });
    });

    // Function to get mouse position relative to SVG element
    const getMousePos = (evt) => {
        const CTM = svgElement.getScreenCTM();
        if (!CTM) return { x: 0, y: 0 };
        try {
            const inverseCTM = CTM.inverse();
            return {
                x: evt.clientX * inverseCTM.a + evt.clientY * inverseCTM.c + inverseCTM.e,
                y: evt.clientX * inverseCTM.b + evt.clientY * inverseCTM.d + inverseCTM.f
            };
        } catch (e) {
            console.error("Error inverting CTM:", e);
            return { // Fallback
                x: (evt.clientX - CTM.e) / CTM.a,
                y: (evt.clientY - CTM.f) / CTM.d
            };
        }
    };

    const calculateDistance = (x1, y1, x2, y2) => {
      return Math.sqrt(Math.pow(x2 - x1, 2) + Math.pow(y2 - y1, 2));
    };

    // Apply scaling based on distance from point to each path center
    const applyScaling = (centerX, centerY, currentRadius = radiusOfInfluence) => {
      pathData.forEach(data => {
        const dist = calculateDistance(centerX, centerY, data.cx, data.cy);
        let scale = minScale;
        if (dist < currentRadius) {
          scale = maxScale - (dist / currentRadius) * (maxScale - minScale);
          scale = Math.max(minScale, Math.min(scale, maxScale));
        }
        data.element.style.transform = `scale(${scale})`;
      });
    };

    // Reset all paths to minimum scale
    const resetScaling = () => {
      pathData.forEach(data => {
        data.element.style.transform = `scale(${minScale})`;
      });
    };

    // Animate the ripple effect (inverse - starts with scaling)
    const animateRipple = (timestamp) => {
      if (!rippleStartTime) rippleStartTime = timestamp;
      const elapsed = timestamp - rippleStartTime;

      if (elapsed < rippleDuration) {
        // Calculate current radius based on animation progress (inverse)
        const progress = elapsed / rippleDuration;
        // Start with small radius and expand outward, with inner area returning to normal
        const innerRadius = progress * maxRippleRadius * 0.8; // Inner circle that returns to normal
        const outerRadius = progress * maxRippleRadius;       // Outer edge of the ripple

        // Apply inverse ripple effect
        pathData.forEach(data => {
          const dist = calculateDistance(rippleX, rippleY, data.cx, data.cy);
          let scale = minScale;

          // If inside the ripple wave (between inner and outer radius)
          if (dist > innerRadius && dist < outerRadius) {
            // Calculate scale based on position in the wave
            const wavePosition = (dist - innerRadius) / (outerRadius - innerRadius);
            // Peak in the middle of the wave
            const waveEffect = Math.sin(wavePosition * Math.PI);
            scale = minScale + (maxScale - minScale) * waveEffect;
          }

          data.element.style.transform = `scale(${scale})`;
        });

        // Continue animation
        requestAnimationFrame(animateRipple);
      } else {
        // Animation complete
        isRippling = false;
        rippleStartTime = 0;
        resetScaling();
      }
    };

    // Start a ripple animation from a specific point
    const startRipple = (x, y) => {
      rippleX = x;
      rippleY = y;
      isRippling = true;
      rippleStartTime = 0;
      requestAnimationFrame(animateRipple);
    };

    // --- Event Listeners on the Container (g.st7) ---
    // Mouse move for hover effect
    pathContainer.addEventListener('mousemove', (event) => {
      if (!isRippling) { // Only apply hover effect if not currently rippling
        const mousePos = getMousePos(event);
        if (mousePos) {
          applyScaling(mousePos.x, mousePos.y);
        }
      }
    });

    // Click for ripple effect
    pathContainer.addEventListener('click', (event) => {
      const mousePos = getMousePos(event);
      if (mousePos) {
        startRipple(mousePos.x, mousePos.y);
      }
    });

    pathContainer.addEventListener('mouseleave', () => {
      if (!isRippling) {
        resetScaling();
      }
    });

  } else {
    console.error("Path container element 'g.st7' not found inside #Layer_1.");
  }
} else {
  console.error("SVG element with ID 'Layer_1' not found.");
}
